  false,\n\t\"url\": null,\n\t\"notes\": \"The nearshore sensors are part of the Pacific
  Islands Ocean Observing System (PacIOOS) and are designed to measure a variety of
  ocean parameters at fixed point locations along the south shore of Oahu. NS03 is
  located at the Atlantis Pier off the Hilton Hawaiian Village. The instrument is
  a Sea-Bird Electronics model 37SMP. The package is located at approximately 2.0
  meters below mean sea level.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
